import React, { useContext, useState } from 'react';
import { BookingContext } from '../../../../context/bookingContext';


require('./styles.css')

const Register = () => {
    const { setShowPopupBook, servicesSelected } = useContext(BookingContext);


    return (
        <>
            <div className='headerPopupBook'>
                <button></button>
                <h3>Registrarse</h3>
            </div>
            <div className='bodyPopupBook'>
                <h3>Crea tu cuenta de Timezzy</h3>
                <input type="email" name="email" placeholder='Dirección de correo eletrónico' />
                <input type="text" name="name" placeholder='Nombre' />
                <input type="text" name="lastname" placeholder='Apellidos' />
                <input type="phone" name="phone" placeholder='Número de teléfono' />
                <input type="password" name="password" placeholder='Contraseña' />

                <button>Crear cuenta</button>
            </div>
        </>
    );
}

export default Register;
